mapproperties.key:
This information defines the preferences of the human user with respect to its favourite movies. The movies appear as a vector of strings representing names of movies. The sessions are a vector of strings representing hours where the user prefers to watch a movie. The preferred extras are those add-ons the cinema may offer, like food (nachos, pop-corns), drinks (colas, juices), or perhaps special services, like smoking rooms. The preferred seats is another vector with the numbers of seats. The preferred price is the highest amount of money the user is willing to pay.
<p>
Example of values expected are 
moviesILike = {"Rambo","Rocky"}
preferredSessions={"1900","2000"}
preferredseats={"1","2"}
preferredPrice=10
preferredExtras={"nachos","smoking-room"}
<p>
The ontologies providing correct values for the different fields are not provided, but already implemented in all agents

